import React from "react";
import gtd from "../../Images/gtd.jpg";

function HeroImg() {
  return (
    <div className="w-full relative">
      <div className="w-full h-full top-0 left-0 absolute"></div>
      <div className="w-full h-full flex flex-col-reverse absolute top-0 left-0 justify-center pl-10 mx-auto md:pl-28 items-start z-30">
        <div className="text-md text-blue-400 uppercase mb-0">
          Take the tour
        </div>
        <div className="text-9xl text-white">e-Golf</div>
      </div>
      <img src={gtd} alt="The new e-Golf" />
    </div>
  );
}

export default HeroImg;
